import React from 'react';
import logo from './logo.svg';
import './App.css';
import { TrieNode } from './trie';
import { connect } from 'react-redux';
import { fetchStockSearchData } from "./stockSearchActions";

class App extends React.Component {
  componentDidMount() {
    const stockTrie = new TrieNode(undefined, {});
    this.props.dispatch(fetchStockSearchData()).then(() => {
      console.log(this.props.stocks);
      for (let stock in this.props.stocks) {
        stockTrie.insert(stockTrie, stock.name);
        console.log(stock.name);
      }
      console.log(stockTrie.children);
      stockTrie.search(stockTrie, "Z");
      console.log(stockTrie.searchResult);
    });
  }

  render() {
    return (
      <div className="App">
        <input type="search" id="stockSearch" placeholder="Facebook" />
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  stocks: state.stocks.items,
});

export default connect(mapStateToProps)(App);
